import React from "react";
import classNames from "classnames";
import "./Button.scss";

function Button({ children, size, color }) {
  return (
    <button className={classNames("Button", size, color)}>{children}</button>
  );
}

Button.defaultProps = {
  size: "medium"
};

export default Button;
